import { useState } from 'react';

import Axios from 'axios';


function ResForm() {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [tel, setTel] = useState("")

  const addCustomer = () =>{
    Axios.post("http://localhost:3003/create", {
      name:name,
      email:email,
      tel:tel
    }).then(() => {
      console.log("ok");
    })
  };

  return (
    <div className="App">
      <div className='Information'> 

        <label> Name</label>
        <input type="text"
          >
        </input>

        <label> Email</label>
        <input type="email"
          >
        </input> 

        <label> Number</label>
        <input type="number"
          onChange={(event) =>{
            setTel(event.target.value)
          }}>
        </input> 

        <button onClick={addCustomer}>Add</button>
      </div>



      {/* ---------------------------- */}

<div>
<div class="contain">

<div class="wrapper">

  <div class="form">
    {/* <h4>GET IN TOUCH</h4> */}
    <h2 class="form-headline">My information</h2>
    {/* <form id="submit-form" action=""> */} <br /><br />
    <form onSubmit={addCustomer} >
      <p>
        <input id="name" class="form-input" type="text" name="user_name" placeholder="Your Name*" onChange={(event) =>{
            setName(event.target.value)
          }}/>
        <small class="name-error"></small>
      </p>
      <p>
        <input id="email" class="form-input" type="email" name="user_email" placeholder="Your Email*"onChange={(event) =>{
            setEmail(event.target.value)
          }}/>
        <small class="name-error"></small>
      </p>

      <p class="full-width">
        <textarea  minlength="20" id="message" cols="30" rows="7" name="message" placeholder="Your Message*" required></textarea>
        <small></small>
      </p>
